query FavoriteCategoriesQuery {
  me {
    ...Categories_me
    __id
  }
}

fragment Categories_me on Me {
  followed_genes(first: 10) {
    pageInfo {
      endCursor
      hasNextPage
    }
    edges {
      node {
        gene {
          id
          __id
          name
          href
          image {
            url
          }
        }
        __id
        __typename
      }
      cursor
    }
  }
  __id
}
